import React, { useEffect, useState } from 'react';
import SignInCarosel from '../employer/signInCarousel';
import { Button } from '@mui/material';
import { ReactComponent as LoginBack } from '../../assets/images/left-nav.svg';
import { useNavigate } from 'react-router-dom';
import './style.scss'

const JobSeekerBanner = (props) => {
  const navigate = useNavigate();
  const [locationValue,setLocationValue] = useState('');
  const handleGoBack = () => {
    navigate(-1); 
  };
  useEffect(() => {
      locationIp();
  }, []);
  const locationIp = () =>{
    try {
      fetch(
        `https://ipapi.co/json/`)
        .then((res) => res.json())
        .then((data) => {
          setLocationValue(data?.city)     
        })

    } catch (error) {
      console.log("Error fetching city name:", error);
    }
  }
  return (
    <div className="SinginFormLeft" style={{backgroundColor: '#fff'}}>
      <Button className='loginBackBtn' onClick={handleGoBack}>
          <LoginBack/>
          <span>Back</span>
      </Button>
            <img src={require('../../assets/images/jobseek.jpg')} className="SinginFormBgImg" alt="" style={{padding: '50px 120px'}} />
            <div className="SinginFormCarouselContainer" style={{top:0,paddingBottom: '30px'}}>
              <div className="SinginFormCarouselTitle">
                Join over 15,000+ <br />
                users around {locationValue}
              </div>
              <SignInCarosel />
            </div>
          </div>
  );
}

export default JobSeekerBanner;
